import React from 'react';
import './SobreNos.css';

function SobreNos() {
  return (
    <div className="sobre-nos">
      <h1>Sobre o Banco de Sangue</h1>
      <p>
        Somos uma plataforma dedicada à gestão eficiente de doadores, estoques de sangue, solicitações hospitalares
        e apoio à saúde coletiva. Nosso objetivo é salvar vidas por meio da tecnologia, conectando doadores a quem mais precisa.
      </p>
    </div>
  );
}

export default SobreNos;
